const Quiz = [
    {
        qs : 'How many months do we have in a year? ',
        a : '8',
        b : '12',
        c : '6',
        d : '9',
        ans : '12'
    },
    {
        qs : 'How many colors are there in a rainbow?',
        a : '11',
        b : '7',
        c : '6',
        d : '9',
        ans : '7'
    },
    {
        qs : 'How many wheels does a motorbike have?',
        a : '5',
        b : '4',
        c : '6',
        d : '7',
        ans : '4'
    },
    {
        qs : 'What is the capital of India?',
        a : 'Chandi garh',
        b : 'Patna',
        c : 'Mumbai',
        d : 'New Delhi',
        ans : 'New Delhi'
    },
    {
        qs : 'How many planets does the solar system consist of?',
        a : '9',
        b : '7',
        c : '8',
        d : '6',
        ans : '8'
    }
];

export default Quiz;
